import axios from 'axios';
import React, { useEffect, useState } from 'react'
import Cards from './Cards'







const Dashborad = () => {

  const [data,setdata] = useState("")
  const getdata = async (id) => {
      const data = await axios.get(`http://192.168.1.39:8070/stud/countStud/${id}`).then((res) => {
        console.log(res.data)
       
        setdata(res.data.data)
      }).catch((err) => {
        console.log(err);
      })
    };
    useEffect(() => {
      getdata();
    }, []);




  function logout(e){
    e.preventDefault();
    localStorage.clear();
   
    axios.post("http://192.168.1.39:8070/admin/login")
    .then(res=>{
      if(res.data.token){
          window.location = '/dashborad'
      }else{
          window.location = '/'      
      }
    })
  }

  //  -----------------------------VIEW

  
  return (
    <div>
       <div className='container mx-0 px-0'>
        <div className='log_out_div'>
            <button className='log_out' onClick={(e)=> logout(e)}>Log out</button>
        </div>
            <div className=' d-flex justify-content-center'>
            <Cards/>
            <Cards/>
            <Cards/>
            </div>
            
            
         </div> 
    </div>
  )
}

export default Dashborad
